ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r){r.id=77;r.slug=a;r.title=g;r.url=a;r.protocol=c;r.type={code:h,description:"Роут"};r.createdAt="2021-09-30T19:13:44+03:00";r.updatedAt="2021-09-30T19:39:09+03:00";r.meta={title:a,description:a,keywords:a};r.content={id:346,text:a,blocks:[]};r.children=[];return {layout:"default",data:[{post:{title:"Этикетка. Маленькая, но такая важная…",slug:"etiketka-malenkaya-no-takaya-vazhnaya",shortDescription:"Когда речь заходит о фирменном стиле, то прежде всего вспоминаются логотипы, корпоративные цвета, дизайн упаковки. А вот этикетка обычно остается за кадром и часто разрабатывается по остаточному принципу. И совершенно напрасно!",createdAt:"2021-12-10T00:00:00+03:00",isImported:f,image:{file:{url:"\u002Fuploads\u002Ffile\u002F9\u002F6\u002F0\u002F9604b2decebafdb14254983c77fa1835.png",name:"9604b2decebafdb14254983c77fa1835.png",originalName:"cover.png",extension:"png",size:"297.9 Кб"}},content:{id:458,text:"\u003Cp\u003EКогда речь заходит о&nbsp;фирменном стиле, то&nbsp;прежде всего вспоминаются логотипы, корпоративные цвета, дизайн упаковки. А&nbsp;вот этикетка обычно остается за&nbsp;кадром и&nbsp;часто разрабатывается по&nbsp;остаточному принципу. И&nbsp;совершенно напрасно! Несмотря на&nbsp;небольшой размер, она играет важную роль и&nbsp;при правильном подходе к&nbsp;разработке способна положительно влиять на&nbsp;продажи. Доказано, что на&nbsp;выбор продуктов FMCG покупатель в&nbsp;среднем тратит около 5&nbsp;секунд. А&nbsp;это значит, что объективные преимущества товара (натуральный состав, свежесть, польза для организма и&nbsp;пр.) остаются неоцененными. В&nbsp;основе выбора&nbsp;&mdash; дизайн упаковки и&nbsp;этикетки. \u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003EКак продает этикетка?\u003C\u002Fstrong\u003E \u003Cbr\u003E\u003Cbr\u003EГрафический дизайн этикетки&nbsp;&mdash; инструмент, который может быть более чем эффективным средством увеличения продаж. Он:\u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E1. Выделяет\u003C\u002Fstrong\u003E \u003Cbr\u003EДаже в&nbsp;самом маленьком магазине любой товар, будь&nbsp;то колбаса, печенье или шампунь, представлен несколькими позициями. А&nbsp;в&nbsp;крупных супермаркетах на&nbsp;полках можно увидеть по&nbsp;20-30 наименований одного и&nbsp;того&nbsp;же продукта разных марок. В&nbsp;ситуации насыщенного ассортимента очень важно привлечь внимание к&nbsp;своему бренду. И&nbsp;этикетка отлично справляется с&nbsp;решением этой задачи! \u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E2. Информирует\u003C\u002Fstrong\u003E \u003Cbr\u003EПривлечение внимания&nbsp;&mdash; это только первый шаг. Итак, ваш продукт заметили. Теперь необходимо рассказать потребителю о&nbsp;качествах и&nbsp;преимуществах товара. Для этого задействуются графические элементы, текст, фото и&nbsp;т.&nbsp;д. Через дизайн можно донести до&nbsp;покупателя информацию о&nbsp;свойствах продукта, ценовом сегменте, натуральном составе и&nbsp;иных характеристиках. \u003Cbr\u003E\u003Cbr\u003E\u003Cstrong\u003E3. Стимулирует\u003C\u002Fstrong\u003E \u003Cbr\u003EПривлекательный дизайн этикетки, как и&nbsp;упаковки в&nbsp;целом, вызывает желание приобрести и&nbsp;попробовать продукт, стимулирует к&nbsp;покупке, заставляет положить товар в&nbsp;корзину. При этом важно отметить, что такой дизайн невозможно создать походя. Его разработке предшествует комплекс маркетинговых исследований, позволяющих изучить предпочтения целевой аудитории.\u003C\u002Fp\u003E\r\n\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\r\n\u003Cblockquote\u003EВажно! Все вышесказанное имеет смысл только при условии грамотного подхода к&nbsp;разработке. И&nbsp;хотя речь идет о&nbsp;дизайне, созданием этикетки должны заниматься не&nbsp;дизайнеры, а&nbsp;команда специалистов. Только совместная работа маркетологов, стратегов, копирайтеров, дизайнеров позволяет создать эффективный инструмент, способный в&nbsp;разы увеличить продажи.\u003C\u002Fblockquote\u003E\r\n\u003Cp\u003E\u003Cem\u003E&nbsp;\u003C\u002Fem\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAizsSURBVHgB7P1Zs2XZeZ6LfXOudvdt9pnVZFYBBYEAJB7iHImKI8thH0bo+ETYF46wwxe+tC\u002F9Dxz+B\u002F4P9oUjTjis45BlhSnpCJREiBRBkABBVKGAarLP3H2\u002F+jU9nm+MMffKQkM01aysfB9qae+9mtkugsyH7\u002FeOYvQv\\u002Fk99o8vXwJ8bXn62EX4vRvZrUbWsmrQv\u002Fx4vz7wWnp+2rRovxT\u002F5Gf7Oz\u002FOzmn2\u002FEEIIIcQrhgSWEEIIIb60uJxKYsqlVHi4gOK58NP\u002F\u002FtwOZhT2NyO7fsG+C\u002Fs7QIKNlqPUGm1YlaXXZNkfklxCCCGE+LIigSWEEEKIlxqXVM0DK1pBUCGmEEOtg89XTn1eIMHah\\u002FQJRZ4dG7o3SWEEIIIT4VJLCEEEII8VuDtCoZC1z+QCkrUVOns9Z+WKezpuf31J0lhBBCiN8aCSwhhBBC\u002FEZIWonfiJTOapDOkswSQgghxG+JBJYQQggh\u002Fk4krcSngmSWEEIIIX5LJLCEEEII8QuRtBK